import axios from 'axios';
import { GET_ERRORS } from './types';

export const createLogbook = (logbook, jwtToken, history) => async dispatch => {
    const config = {
        method: 'POST',
        url: `/add/logbook/${jwtToken}`,
        data: logbook,
        headers: {
            "Accept": "application/json",
            "Content-type": "application/json"
        }
    }
    try {
        await axios.post(config);
        history.push("/logbook");

        dispatch({
            type: GET_ERRORS,
            payload: {}
        })
    } catch(err) {
        dispatch({
            type: GET_ERRORS,
            payload: err.response.data
        })
    }
};
